	(1090, 'Our lightest and best quality aluminum frame made from the newest alloy; it is welded and heat-treated for strength. Our innovative design results in maximum comfort and performance.', '{7054C83C-BD9B-4E24-8476-4D1B37BB08DF}', '2007-06-01 00:00:00.000'),
	(1146, 'Lightweight butted aluminum frame provides a more upright riding position for a trip around town.  Our ground-breaking design provides optimum comfort.', '{39A06654-8E9A-4B56-A943-FCA2598BC444}', '2007-06-01 00:00:00.000'),
	(1182, 'The HL aluminum frame is custom-shaped for both good looks and strength; it will withstand the most rigorous challenges of daily riding. Men''s version.', '{87A7609B-8CFF-4B60-9AF0-E0E5045E4A2D}', '2007-06-01 00:00:00.000'),
