	(1484, 'Acier chromé.', '{7F3423F0-9EF6-460E-A08A-925AEFABD39A}', '2007-06-01 00:00:00.000'),
	(1485, 'Cuvettes en alliage d''aluminium ; axe de grand diamètre.', '{DBF35181-8CD5-4641-BAB5-6BDFA8441112}', '2007-06-01 00:00:00.000'),
	(1486, 'Cuvettes en alliage d''aluminium et axe creux.', '{3D57BA93-2856-4FF7-8B17-8DBED99109AB}', '2007-06-01 00:00:00.000'),
	(1487, 'Adapté à tous les usages, sur route ou tout-terrain. Pour toutes les bourses. Changement de braquet en douceur et conduite confortable.', '{5C1DAB3A-4B31-4D9D-A14F-3CB61949B79B}', '2007-06-01 00:00:00.000'),
	(1488, 'Ce vélo offre un excellent rapport qualité-prix. Vif et facile à manœuvrer, il se conduit en toute tranquillité sur les chemins et les sentiers.', '{79065EC8-2080-4120-A4EA-BFA7EA1F1F9D}', '2007-06-01 00:00:00.000'),
	(1489, 'Pour les véritables passionnés du VTT. Un vélo extrêmement robuste qui vous permettra d''aller partout, même sur les terrains difficiles, pour un budget raisonnable.', '{93463372-82EF-4EC4-BA0F-DA371A6FBEF6}', '2007-06-01 00:00:00.000'),
	(1490, 'Conduite sur terrains très accidentés. Idéal pour tous les niveaux de compétition. Utilise le même cadre HL que le Montain-100.', '{2B6FA2A7-4815-47B6-A6BC-D6AEC23B85CC}', '2008-03-11 10:32:17.973'),
	(1491, 'VTT de compétition haut de gamme. Plusieurs options d''amélioration des performances : cadre HL, suspension avant particulièrement souple et traction adaptée à tous les terrains.', '{3D73A955-289A-47C1-BF47-596EB0CBBAA1}', '2007-06-01 00:00:00.000'),
	(1492, 'Adapté à tous les terrains. Pour toutes les bourses.', '{2198E171-CF84-44E2-8B73-342A45E18366}', '2007-06-01 00:00:00.000'),
	(1493, 'Vélo d''adulte d''entrée de gamme ; permet une conduite confortable en ville ou sur les chemins de campagne. Moyeux et rayons à blocage rapide.', '{7943455F-3FBE-44C0-9AC2-7EE642D3944B}', '2007-06-01 00:00:00.000'),
	(1494, 'Vélo très séduisant comportant de nombreuses caractéristiques des modèles haut de gamme. Bénéficie du cadre léger et rigide, mais aussi de la ligne performante qui ont fait notre réputation.', '{485B21FE-A5B5-4DF2-A2F8-3DE106F08EF1}', '2007-06-01 00:00:00.000'),
	(1495, 'Équipé de la même technologie que tous nos vélos de route, avec un cadre femmes. Idéal pour la promenade ou la course sur route.', '{8B97634A-52F9-4A5C-93EA-6B6B15D1F5DD}', '2007-06-01 00:00:00.000'),
	(1496, 'Équipé de la même technologie que tous nos vélos de route. Idéal pour la promenade ou la course sur route.', '{33060E1F-C997-4D6A-ADE7-C68FB620D5CE}', '2007-06-01 00:00:00.000'),
	(1497, 'Un véritable vélo multi-sports, qui offre une conduite optimisée et une ligne révolutionnaire. Sa ligne aérodynamique vous permet de l''utiliser en course et ses vitesses de gravir les cols.', '{3E4964DC-A697-481F-9374-E6F67E89808D}', '2007-06-01 00:00:00.000'),
	(1498, 'VTT, course ou promenade entre amis sur un vélo aérodynamique et léger. Bénéficie d''un système de selle perfectionné qui offre un confort optimal.', '{F484E5C5-BFD4-4220-8B2A-677F2F49B3EE}', '2007-06-01 00:00:00.000'),
	(1499, 'Tout terrain, course ou promenade entre amis sur un vélo aérodynamique et léger (cadre femmes). Bénéficie d''un système de selle perfectionné qui offre un confort optimal.', '{559C08EF-739C-4979-88E0-8165F9F6BA77}', '2007-06-01 00:00:00.000'),
	(1500, 'Cadre en alliage d''aluminium qui offre une conduite légère et rapide, sur pistes ou sur routes de campagne.', '{DE8DFD6B-A04F-4865-99A1-A2A88CE92993}', '2007-06-01 00:00:00.000'),
	(1501, 'Ce vélo est destiné aux champions cyclistes. Mis au point par une équipe cycliste professionnelle, ce vélo possède un cadre en aluminium traité à chaud extrêmement léger et un guidon qui permet une conduite très précise.', '{710C56B1-C463-48FF-87F1-15D2EA58B029}', '2007-06-01 00:00:00.000'),
	(1502, 'Vélo de qualité pour tous usages, doté d''un bon niveau de confort et de sécurité. Présente des pneus plus larges et plus stables pour les sorties en ville ou les randonnées du week-end.', '{E5288050-BC5B-45CC-8849-C7D4AF2FE2B6}', '2007-06-01 00:00:00.000'),
	(1503, 'La selle rembourrée offre un confort optimal. Le porte-bagages nouvellement remanié offre diverses possibilités d''ajout de paniers ou de sacoches. Ce vélo reste parfaitement stable une fois chargé.', '{28B132C3-108C-412D-9918-A8C9297DFB73}', '2007-06-01 00:00:00.000'),
	(1504, 'Voyagez confortablement et avec élégance. Confort et sécurité maximum. Large éventail de vitesses pour gravir toutes les côtes. Sa fabrication en alliage d''aluminium haute technologie est synonyme de robustesse, sans ajout de poids.', '{E3BAC4A6-220C-4E5E-8261-51E08906C0E8}', '2007-06-01 00:00:00.000'),
	(1505, 'Système de changement de vitesse très performant.', '{426FE762-42C4-4843-9C02-B6FA45ECC29C}', '2007-06-01 00:00:00.000'),
	(1506, 'Axe très rigide.', '{73983734-E8F7-4681-9D7F-9ABAD24BB609}', '2007-06-01 00:00:00.000'),
	(1507, 'Manivelle haute résistance.', '{1075B851-8AEF-46C8-9A97-D45E1B23398C}', '2007-06-01 00:00:00.000'),
	(1508, 'Pédalier triple plateaux ; manivelle en aluminium ; changement de braquet impeccable.', '{7D23FB50-63D3-4F41-ADAB-EBAB93846BF7}', '2007-06-01 00:00:00.000'),
	(1509, 'Patins de freinage pour tous les temps ; freinage renforcé par l''application d''une plus grande surface sur la jante.', '{5ED8186A-6049-42B1-B1B0-3B1F899C538B}', '2007-06-01 00:00:00.000'),
	(1510, 'Conception liaison large.', '{64723C0C-09D5-497D-83A3-4561818A8F1C}', '2007-06-01 00:00:00.000'),
	(1511, 'Conception robuste permettant d''absorber les chocs et d''offrir une conduite plus précise.', '{4E0F2242-6EE6-4757-8ECF-0B9E0C23304D}', '2007-06-01 00:00:00.000'),
	(1512, 'Fourche composite pour route avec tube de direction en aluminium.', '{04902A2E-7819-4EBE-BC8A-8A115DF1356E}', '2007-06-01 00:00:00.000'),
	(1513, 'Fourche pour route en carbone hautes performances avec bras incurvés.', '{2F6EAF45-D217-4E62-9676-A3B22AD07DDE}', '2007-06-01 00:00:00.000'),
	(1514, 'Utilise la même technologie de cadre que celle adoptée sur le cadre en aluminium ML.', '{F5D3B83B-8A70-4A64-84AB-8AFE20D5791D}', '2007-06-01 00:00:00.000'),
	(1515, 'Le cadre ML est un cadre en aluminium traité à chaud fabriqué avec le même niveau de détail et de qualité que notre cadre HL. Il offre des performances exceptionnelles. Version hommes.', '{DBA0A067-F4FF-450B-B33C-65E2EAB7AFBC}', '2007-06-01 00:00:00.000'),
	(1516, 'Le cadre ML est un cadre en aluminium traité à chaud fabriqué avec le même niveau de détail et de qualité que notre cadre HL. Il offre des performances exceptionnelles. Version femmes.', '{CE88BAC5-991C-49BB-A970-34AAC6458A80}', '2007-06-01 00:00:00.000'),
	(1517, 'Doté du même alliage en aluminium que notre cadre HL haut de gamme, le ML possède un tube léger dont le diamètre est prévu pour offrir une résistance optimale. Version femmes.', '{F3CD990A-B70D-43C8-A075-934A3E98B5AA}', '2007-06-01 00:00:00.000'),
	(1518, 'Roue de secours tout-terrain pour vététiste occasionnel.', '{5E0E8215-C919-4F17-8210-27ED63D6E605}', '2007-06-01 00:00:00.000'),
